import React from 'react'
import AppButton from './ui/AppButton'

const App = ({ color }) => {
  console.log(color);
  return (
    <div className='p-5 space-y-4'>
      <AppButton color='red' data='click' />
      <AppButton color='red' data='click' />
      <AppButton color='red' data='click' />
      <AppButton color='red' data='click' />

    </div>
  )
}

export default App
